import React from "react";
import "./calendar.css";
import EventPanel from "./eventPanel";

const Calendar = () => {
  return (
    <div className="calendar">
      <h1>My events</h1>
      <div className="events">
        <EventPanel />
      </div>
    </div>
  );
};

export default Calendar;
